import { lazy } from "react";
import { Listing } from "./MobileListing";
const Edit =lazy(() => import("./Edit").then((module) => ({ default: module.Edit }))); // from "./Edit";
import { MobileDetails } from "./ShowDetails";
import { PostingData } from "./Uploads";
export {Listing,Edit,MobileDetails,PostingData}
